import React from 'react';
import ReactDOM from 'react-dom';

let options = [['Date:', 'Time:', 'Priority:', 'Title:', 'Description:', 'Category:'],[]]
let style;
let getInputBoxes = () =>{
    options[0].forEach(option =>{
        return(
            <div>
                <body>
                    {option}
                </body>
                <input type='text'/>
            </div>
        );
    });
}
export default class TaskCreate extends React.Component{
    render(){
        return(
            <div className = "taskCreateWindow">
                <body className = 'taskCreateTitle' top = '10%'>
                    New Task
                    <input className='taskCreateInput' type="text" />
                </body>
                {
                    getInputBoxes()
                }
            </div>
        );
    }
}
